function AddButtonGrey(onPress) {
    return (
      <div className='mx-auto'>
        <button className="border-2 h-[50px] w-[100%] rounded-xl border-dashed" onClick={onClick}>
            <img src={iconPlus} alt='iconPlus' className='w-[35px] h-[35px] mx-auto'/>
        </button>
      </div>
    );
  }

  export default AddButtonGrey;
